import "../Nav bar/Nav.css";
import { Link, NavLink } from "react-router-dom";
import { useState } from "react";
import Market from "../market store/market";
import img from "../Nav bar/images/googleAdv.png";
import searchh from "../Nav bar/images/Group 1.png";
import icon1 from "./images/Group 281.png";
import icon2 from "./images/Group 2.png";
import icon3 from "./images/Vector (1).png";

function Nav() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuToggle = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className="Nav">
      {/* img adv in nav */}
      <img src={img} alt="Advertisement" />
      <br />

      {/* Button for toggling menu on small screens */}
      <button className="menu-toggle" onClick={handleMenuToggle}>
        â˜°
      </button>

      {/* Menu container */}
      <div className={`nav-content ${isMenuOpen ? 'open' : ''}`}>
        <div className="nav1">
          <h1>Selle easily on our store</h1>
          <div className="home">
            <NavLink to='/Home'>Home</NavLink>
            <NavLink to="/market">Market Store</NavLink>
            <NavLink to="/about">About Us</NavLink>
            <NavLink to="/contact">Contact</NavLink>
          </div>

          <div className="log">
            <Link id="Link" to="/sign">
              <h1>Sign Up</h1>
            </Link>
            <Link id="Link" to="/login">
              <h1>Log in</h1>
            </Link>
          </div>
        </div>
        <div className="nav2">
          <div id="logo"><h1>Logo</h1></div>
          <div className="search">
            <img src={searchh} alt="Search Icon" />
            <input type="search" placeholder="Look for anything you want" />
            <button>Search</button>
            <div className="icons">
              <img src={icon1} alt="Icon 1" />
              <Link to="/cart">
                <img src={icon2} alt="Cart Icon" />
              </Link>
              <img src={icon3} alt="Icon 3" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Nav;
